import './App.css';
import SingleColor from './SingleColor';

function App() {
  return (
    <div className="app">
      <header>
        <div className='container'>
          <h4 className='title'>Color Generator</h4>
          <form>
            <input type='text' placeholder='#f15025'/>
            <button type='submit' className='btn btn-success'>Generate</button>
          </form>
        </div>
      </header>
      <div className='colors-container'>
        <SingleColor />
      </div>
    </div>
  );
}

export default App;
